// Import the logo image and CSS file
import logo from './logo.svg';
import './App.css';

// Define the main App component
function App() {
  return (
    // Main container div with a class name "App"
    <div className="App">
      {/* Header section with a class name "App-header" */}
      <header className="App-header">
        {/* Display the logo image with a class name "App-logo" */}
        <img src={logo} className="App-logo" alt="logo" />
        {/* Paragraph element displaying a welcome message */}
        <p>
          Welcome to APDS
        </p>
        {/* Anchor element displaying a message about using React */}
        <a>
          We are using React for the Frontend Only
        </a>
      </header>
    </div>
  );
}

// Export the App component as the default export
export default App;
